import React from "react";

class MenuList extends React.Component {
  state = {
    menu: "",
  };
  handleOnlickHome = () => {
    this.setState({
      menu: "home",
    });
  };
  handleOnlickTodo = () => {
    this.setState({
      menu: "todo",
    });
  };
  render() {
    return (
      <>
        <ul className="breadcrumb">
          <li>
            <a
              href="#"
              onClick={() => {
                this.handleOnlickHome();
              }}
            >
              Home
            </a>
          </li>
          <li>
            <a
              href="#"
              onClick={() => {
                this.handleOnlickTodo();
              }}
            >
              Todo
            </a>
          </li>
        </ul>
      </>
    );
  }
}
export default MenuList;
